import React, { useState } from "react"
import { useHistory, useParams } from "react-router-dom"
import "../assets/css/layout.css"
import { Nav, TabContent } from "react-bootstrap"
import Data from "../Data"
import Breadcrumb from "../components/common/breadcrumb"
import PagnationTool from "../PagnationTool"
import one from "../assets/images/product/1.png"

const PriceDitail = () => {
  const history = useHistory()
  let [tab, settab] = useState(0)
  // const [en, seten] = useState(false);
  // const [zn, setzn] = useState(false);
  // // const 영어관리스위치 = () => {
  //   seten(!en);
  // };
  return (
    <>
      <Breadcrumb title="지난정산내역상세" parent="정산내역관리" />
      <div className="container-fluid">
        <div className="row">
          <div className="col-sm-12">
            <div className="card">
              <div className="card-body">
                <div className="ment-box">
                  <h2>지난 정산내역 상세</h2>
                </div>
                <div className="card-body">
                  <div className="table-responsive">
                    <table className="table">
                      <thead className="thead-light">
                        <tr>
                          <th scope="col" />
                          <th scope="col">정산일</th>
                          <th scope="col">은행명</th>
                          <th scope="col">계좌번호</th>
                          <th scope="col">입금자명</th>
                          <th scope="col">입금금액</th>
                        </tr>
                      </thead>
                      <tbody>
                        {Data.map(a => {
                          return (
                            <tr>
                              <th scope="row" key={a.id}>
                                {a.id}
                              </th>
                              <td>{a.datea}</td>

                              <td>{a.bank}</td>

                              <td>{a.bankno}</td>
                              <td>{a.name}</td>
                              <td>{a.KoreaPr}</td>
                            </tr>
                          )
                        })}
                      </tbody>
                    </table>
                  </div>
                </div>

                <GuideSome />
              </div>
            </div>
          </div>
        </div>
